import React, { useState } from "react";
import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./ExpenseFilter/ExpenseFilter";
import Card from "../Card/Card"

const Expenses = (props) => {

    const [yearSelected,setYear] = useState("2020")

    const filterFunction = (year) => {
        console.log(year)
        setYear(year)
    }

    const expenses = props.expenseList.map((expense) => {
        return (<ExpenseItem title = {expense.title} amount = {expense.amount} date = {expense.date}></ExpenseItem>)
    })

    return (
        <Card className = "expenses"> 
            <div>
                <ExpensesFilter defaultYear = {yearSelected} filterYear = {filterFunction}></ExpensesFilter>
                {expenses}
            </div>
        </Card>
    )
}

export default Expenses;
